import React, {Component} from 'react'

const ProfileCard = (props) => {
  console.log(props);

  return(
    <div>
      <div className="profile-card">
      <p>Name: {props.user.name} </p>
      <p>Car: {props.user.car} </p>
      <p>Experience: {props.user.experience} </p>
      <p>Rating: {props.user.rating} </p>
      <p>Companies: {props.user.companies? props.user.companies.map(company => company.name) : "nope"} </p>
      <p>Base Locaion: {props.user.location}</p>
      </div>
      Profile!
    </div>
  )
}


export default ProfileCard
